            if (goalsScored > 0) {
                $(this).find('.score-select').addClass('active');
            }
            else {
                $(this).find('.score-select').removeClass('active');
            }
            // Multiple the goals total by 10 if its a Goalkeeper
            goalsTotal = goalsScored * 10;
